/*Table structure for table `productmaster` */

DROP TABLE IF EXISTS `productmaster`;

CREATE TABLE `productmaster` (
  `productId` int(11) NOT NULL AUTO_INCREMENT,
  `productName` varchar(100) NOT NULL,
  `productDescription` varchar(100) NOT NULL,
  `productPrice` varchar(100) NOT NULL,
  `product_CategoryId` int(11) DEFAULT NULL,
  `product_SubCategoryId` int(11) DEFAULT NULL,
  `product_BrandId` int(11) DEFAULT NULL,
  `product_ColorTypeId` int(11) DEFAULT NULL,
  `product_SizeId` int(11) DEFAULT NULL,
  `product_LoginId` int(11) DEFAULT NULL,
  PRIMARY KEY (`productId`),
  KEY `product_CategoryId` (`product_CategoryId`),
  KEY `product_SubCategoryId` (`product_SubCategoryId`),
  KEY `product_BrandId` (`product_BrandId`),
  KEY `product_ColorTypeId` (`product_ColorTypeId`),
  KEY `product_SizeId` (`product_SizeId`),
  KEY `product_LoginId` (`product_LoginId`),
  CONSTRAINT `productmaster_ibfk_1` FOREIGN KEY (`product_CategoryId`) REFERENCES `categorymaster` (`categoryId`),
  CONSTRAINT `productmaster_ibfk_2` FOREIGN KEY (`product_SubCategoryId`) REFERENCES `subcategorymaster` (`subCategoryId`),
  CONSTRAINT `productmaster_ibfk_3` FOREIGN KEY (`product_BrandId`) REFERENCES `brandmaster` (`brandId`),
  CONSTRAINT `productmaster_ibfk_4` FOREIGN KEY (`product_ColorTypeId`) REFERENCES `colortypemaster` (`colorTypeId`),
  CONSTRAINT `productmaster_ibfk_5` FOREIGN KEY (`product_SizeId`) REFERENCES `sizemaster` (`sizeId`),
  CONSTRAINT `productmaster_ibfk_6` FOREIGN KEY (`product_LoginId`) REFERENCES `loginmaster` (`loginId`)
) ENGINE=InnoDB AUTO_INCREMENT=347 DEFAULT CHARSET=latin1;

